import { Routes, Route, Link } from "react-router-dom";
import { Task1 } from "../views/Task1.js";
import { Task2 } from "../views/Task2.js";
import { Task3 } from "../views/Task3.js";
import { Task5 } from "../views/Task5.js";
import { Task6 } from "../views/Task6.js";
import App from "../App.js";

export const indexRoutes = () => {
    <Routes>
        <Route path="/" exact element={<App />} />
        <Route path="/task-1" element={<Task1 />} />
        <Route path="/task-2" element={<Task2 />} />
        <Route path="/task-3" element={<Task3 />} />
        <Route path="/task-5" element={<Task5 />} />
        <Route path="/task-6" element={<Task6 />} />
    </Routes>
}
